import { combineReducers } from 'redux';
import movie_one from './movie_one';
import movie_two from './movie_two';
import movie_three from './movie_three';

const AllReducers = combineReducers({
    mOne: movie_one,
    mTwo: movie_two,
    mThree: movie_three

})

export default AllReducers;
